          <Heart className="w-5 h-5" />
        </button>
      </div>
      <div className="p-4">
        <h3 className="font-bold text-gray-900 truncate">{name}</h3>
        <div className="flex items-center mt-1 space-x-1">
            <div className="flex text-yellow-400">
                {[...Array(5)].map((_, i) => (
                    <Star key={i} className={`w-4 h-4 ${i < Math.floor(rating) ? 'fill-current' : 'text-gray-300'}`} />
                ))}
            </div>
            <span className="text-xs text-gray-500">({reviews})</span>
        </div>
        <div className="flex items-center justify-between mt-4">
          <span className="text-lg font-bold text-blue-600">{price}</span>
          <button className="p-2 bg-gray-50 text-gray-600 rounded-lg hover:bg-blue-600 hover:text-white transition-colors">
            <ShoppingCart className="w-5 h-5" />
          </button>
        </div>
      </div>
    </div>
  );
